actionConfiguration.body:
() => {
  NoteMesecorr.run();
  NoteMesePrec.run();
  let divisione = NoteMesecorr.data[0].count / NoteMesePrec.data[0].count - 1;
  let perc = divisione * 100;
  if (perc > 100) {
    var percentage = perc + '% in più rispetto al mese precedente';
  } else {
    percentage = perc + '% in meno rispetto al mese precedente';
  }
  storeValue('percentage', percentage, false);
  return [divisione, perc];
}

